package org.example.icatch.dto;public class CameraSetupRequest {    private Integer userId;    private Integer deviceId;    private String cameraName;    private String target_Type;    public CameraSetupRequest() {    }    public CameraSetupRequest(Integer userId, Integer deviceId, String cameraName, String target_Type) {        this.userId = userId;        this.deviceId = deviceId;        this.cameraName = cameraName;        this.target_Type = target_Type;    }    public Integer getUserId() {        return userId;    }    public void setUserId(Integer userId) {        this.userId = userId;    }    public Integer getDeviceId() {        return deviceId;    }    public void setDeviceId(Integer deviceId) {        this.deviceId = deviceId;    }    public String getCameraName() {        return cameraName;    }    public void setCameraName(String cameraName) {        this.cameraName = cameraName;    }    public String getTarget_Type() {        return target_Type;    }    public void setTarget_Type(String target_Type) {        this.target_Type = target_Type;    }}